import navbar from './Nav.module.css'
const Nav = () => {
    return (
        <nav className={navbar.sidebar}>
            <div> <a href="/profile">Profile</a> </div>
            <div> <a href="/dialogs">News</a> </div>
            <div> <a href="/">Music</a> </div>
            <div> <a href="/">Post</a> </div>
            <div> <a className={navbar.sidebar_setting} href="#" >Setting</a> </div>
        </nav>
    );
}

export default Nav;
